def all_to_time(all_copter_points, n):
    time_points = [[0]*len(all_copter_points) for i in range(n)]
    for c in range(len(all_copter_points)):
        for t in range(n):
            time_points[t][c] = (all_copter_points[c][t][1],all_copter_points[c][t][2],all_copter_points[c][t][3])
    return time_points



def load_points(all_copter_points, directory):
    names = os.listdir(directory)
    for name in names:
        f = open(os.path.join(directory, name) ,"r")
        count = 0
        for line in f:
            if count == 2:
                xpoints = line.split(' ')[-1][1:-1]
            if count == 3:
                n = int(line.split(' ')[-1])
            count += 1
        all_copter_points.append(parse_points(n, xpoints))
