def is_collide_two(time_points, n):
    border_distance = 300
    count = 0
    for i in range(len(time_points)):
        time_points[i].sort()
        for j in range(n):
            k = j + 1
            while k < n and abs(time_points[i][j][0] - time_points[i][k][0]) < border_distance:
                x1 = time_points[i][j][0]
                y1 = time_points[i][j][1]
                z1 = time_points[i][j][2]
                x2 = time_points[i][k][0]
                y2 = time_points[i][k][1]
                z2 = time_points[i][k][2]
                distance = math.sqrt((x1 - x2) ** 2 + (y1 - y2) ** 2 + (z1 - z2) ** 2)
                if j != k and distance < 300:
                    print("Collide", int(distance), j, k)
                    count += 1
                k += 1
    print(count)

